import './Card.css';

function Card(props) {
  return (
    <div id={props.id} className='Card'>
      <h2 className='Card-header'>{props.header}</h2>
      <div className='Card-heading-accent-container'>
        <div className='Card-heading-accent' />
      </div>
      <div className='Card-children-container'>
        {props.children}
      </div>
    </div>
  );
}

export default Card;
